void* Rogue_as( void* obj, RogueInt recast_type_id )
{
  if ( !obj ) return 0;
  RogueRuntimeType* type = ((RogueObject*)obj)->__type;
  if (type->index == recast_type_id) return obj;

  RogueInt* base_indices = type->base_type_indices - 1;
  RogueInt  count = type->base_type_count;
  while (--count >= 0)
  {
    if (*(++base_indices) == recast_type_id) return obj;
  }
  return 0;
}

RogueLogical Rogue_instance_of( void* obj, RogueInt ancestor_id )
{
  if ( !obj ) return 0;
  RogueRuntimeType* type = ((RogueObject*)obj)->__type;
  if (type->index == ancestor_id) return 1;

  RogueInt* base_indices = type->base_type_indices - 1;
  RogueInt  count = type->base_type_count;
  while (--count >= 0)
  {
    if (*(++base_indices) == ancestor_id) return 1;
  }
  return 0;
}

RogueLogical Rogue_is_type( void* obj, RogueRuntimeType* type )
{
  if ( !obj ) return 0;
  return ((RogueObject*)obj)->__type == type;
}


