void  Rogue_collect_garbage( void )
{
  RogueMM_bytes_allocated_since_gc = 0;
  RogueMM_gc_request = 0;

  RogueObject*  ref;
  RogueObject** refptr;
  RogueInt i;
  RogueInt write_i;

  // Trace all retained objects (positive refcount)
  for (i=RogueMM_objects.count, refptr=RogueMM_objects.data-1; --i>=0; )
  {
    if ((ref=(RogueObject*)*(++refptr)) && ref->__refcount > 0) ref->__type->fn_gc_trace(ref);
  }

  // Trace singletons
  if ((ref = (RogueObject*)RogueGlobal_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueStringPool_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueConsole_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueObjectPoolxRogueStringx_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueMorlock_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueFunction_561_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueFunction_563_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueFunction_649_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueFunction_650_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueSystemEnvironment_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueObjectPoolxRogueUTF16Stringx_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueBootstrap_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueFunction_765_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueFunction_766_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueFunction_770_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueFunction_771_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueWorkListxRogueStringx_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueWorkListxRogueString_Defaultx_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueFunction_809_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueFunction_810_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueFunction_816_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueFunction_817_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueFunction_818_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueFunction_842_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueFunction_843_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueFunction_844_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueFunction_845_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueFunction_846_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueWorkListxRogueByte_Ax_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueWorkListxRogueByte_Bx_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueWorkListxRogueBytex_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueWorkListxRogueByte_Defaultx_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueFunction_851_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueFunction_852_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueFunction_853_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueFunction_871_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueFunction_872_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueFunction_875_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueFunction_877_singleton) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);

  // Trace globals
  if ((ref = (RogueObject*)RogueGlobalID__g_categories) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueSystem__g_command_line_arguments) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueSystem__g_executable_filepath) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueStringEncoding__g_categories) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueFileListingOption__g_categories) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueConsoleEventType__g_categories) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueTimsortxRogueStringx__g_runs) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueZipEntry__g_buffer) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  if ((ref = (RogueObject*)RogueUnixConsoleMouseEventType__g_categories) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);

  // Trace stack
  void** v;

  for (i=TypeRogueObject.local_pointer_count, v=TypeRogueObject.local_pointer_stack-1; --i>=0; )
  {
    if ((ref=(RogueObject*)(*(RogueObject**)*(++v))) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  }
  for (i=TypeRogueFile.local_pointer_count, v=TypeRogueFile.local_pointer_stack; --i>=0; ++v )
  {
    if ((ref=(RogueObject*)((*((RogueFile*)(*v))).filepath)) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  }
  for (i=TypeRogueOptionalFile.local_pointer_count, v=TypeRogueOptionalFile.local_pointer_stack; --i>=0; ++v )
  {
    if ((ref=(RogueObject*)((*((RogueOptionalFile*)(*v))).value.filepath)) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  }
  for (i=TypeRogueVariant.local_pointer_count, v=TypeRogueVariant.local_pointer_stack; --i>=0; ++v )
  {
    if ((ref=(RogueObject*)((*((RogueVariant*)(*v))).object)) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  }
  for (i=TypeRogueOptionalString.local_pointer_count, v=TypeRogueOptionalString.local_pointer_stack; --i>=0; ++v )
  {
    if ((ref=(RogueObject*)((*((RogueOptionalString*)(*v))).value)) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  }
  for (i=TypeRogueListRewriterxRogueStringx.local_pointer_count, v=TypeRogueListRewriterxRogueStringx.local_pointer_stack; --i>=0; ++v )
  {
    if ((ref=(RogueObject*)((*((RogueListRewriterxRogueStringx*)(*v))).list)) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  }
  for (i=TypeRogueTableEntriesIteratorxRogueVariant_RogueVariantx.local_pointer_count, v=TypeRogueTableEntriesIteratorxRogueVariant_RogueVariantx.local_pointer_stack; --i>=0; ++v )
  {
    if ((ref=(RogueObject*)((*((RogueTableEntriesIteratorxRogueVariant_RogueVariantx*)(*v))).cur)) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  }
  for (i=TypeRogueTableKeysIteratorxRogueVariant_RogueVariantx.local_pointer_count, v=TypeRogueTableKeysIteratorxRogueVariant_RogueVariantx.local_pointer_stack; --i>=0; ++v )
  {
    if ((ref=(RogueObject*)((*((RogueTableKeysIteratorxRogueVariant_RogueVariantx*)(*v))).cur)) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  }
  for (i=TypeRogueOptionalVariant.local_pointer_count, v=TypeRogueOptionalVariant.local_pointer_stack; --i>=0; ++v )
  {
    if ((ref=(RogueObject*)((*((RogueOptionalVariant*)(*v))).value.object)) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  }
  for (i=TypeRogueOptionalTableEntryxRogueVariant_RogueVariantx.local_pointer_count, v=TypeRogueOptionalTableEntryxRogueVariant_RogueVariantx.local_pointer_stack; --i>=0; ++v )
  {
    if ((ref=(RogueObject*)((*((RogueOptionalTableEntryxRogueVariant_RogueVariantx*)(*v))).value)) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  }
  for (i=TypeRogueFilePattern.local_pointer_count, v=TypeRogueFilePattern.local_pointer_stack; --i>=0; ++v )
  {
    if ((ref=(RogueObject*)((*((RogueFilePattern*)(*v))).pattern)) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  }
  for (i=TypeRogueOptionalFilePattern.local_pointer_count, v=TypeRogueOptionalFilePattern.local_pointer_stack; --i>=0; ++v )
  {
    if ((ref=(RogueObject*)((*((RogueOptionalFilePattern*)(*v))).value.pattern)) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  }
  for (i=TypeRogueStackTraceFrame.local_pointer_count, v=TypeRogueStackTraceFrame.local_pointer_stack; --i>=0; ++v )
  {
    if ((ref=(RogueObject*)((*((RogueStackTraceFrame*)(*v))).procedure)) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
    if ((ref=(RogueObject*)((*((RogueStackTraceFrame*)(*v))).filename)) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  }
  for (i=TypeRogueTableKeysIteratorxRogueString_RogueStringx.local_pointer_count, v=TypeRogueTableKeysIteratorxRogueString_RogueStringx.local_pointer_stack; --i>=0; ++v )
  {
    if ((ref=(RogueObject*)((*((RogueTableKeysIteratorxRogueString_RogueStringx*)(*v))).cur)) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  }
  for (i=TypeRogueTableValuesIteratorxRogueString_RogueStringx.local_pointer_count, v=TypeRogueTableValuesIteratorxRogueString_RogueStringx.local_pointer_stack; --i>=0; ++v )
  {
    if ((ref=(RogueObject*)((*((RogueTableValuesIteratorxRogueString_RogueStringx*)(*v))).cur)) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  }
  for (i=TypeRogueVersionNumber.local_pointer_count, v=TypeRogueVersionNumber.local_pointer_stack; --i>=0; ++v )
  {
    if ((ref=(RogueObject*)((*((RogueVersionNumber*)(*v))).version)) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  }
  for (i=TypeRogueBestxRogueStringx.local_pointer_count, v=TypeRogueBestxRogueStringx.local_pointer_stack; --i>=0; ++v )
  {
    if ((ref=(RogueObject*)((*((RogueBestxRogueStringx*)(*v))).better_fn)) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
    if ((ref=(RogueObject*)((*((RogueBestxRogueStringx*)(*v))).value)) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  }
  for (i=TypeRogueZipEntry.local_pointer_count, v=TypeRogueZipEntry.local_pointer_stack; --i>=0; ++v )
  {
    if ((ref=(RogueObject*)((*((RogueZipEntry*)(*v))).zip)) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
    if ((ref=(RogueObject*)((*((RogueZipEntry*)(*v))).name)) && ref->__refcount >= 0) ref->__type->fn_gc_trace(ref);
  }

  // Find unreferenced objects requiring cleanup, trace them, and move them to
  // the end of the regular list.

  // We can't delete them yet because they could add themselves back to the object
  // graph during cleanup. They'll be deleted from the regular list the next time
  // they're unreferenced with no chance to clean up again.
  RogueInt cleanup_count = 0;
  RogueInt end_i = RogueMM_objects_requiring_cleanup.count;
  refptr = RogueMM_objects_requiring_cleanup.data + end_i;
  for (i=end_i; --i>=0; )
  {
    ref = (RogueObject*) *(--refptr);
    if (ref->__refcount >= 0)
    {
      ++cleanup_count;
      ref->__type->fn_gc_trace( ref );

      RogueMMObjectList_add( &RogueMM_objects, ref );
      *refptr = RogueMM_objects_requiring_cleanup.data[--end_i];
    }
  }
  RogueMM_objects_requiring_cleanup.count -= cleanup_count;

  // Null out weak references to objects that are about to be deleted.
  RogueWeakReference* cur = RogueMM_weak_references;
  while (cur)
  {
    if (cur->object && cur->object->__refcount >= 0)
    {
      // The object ref held by this weak reference is about to be
      // deleted by the GC system; null out the object.
      cur->object = 0;
    }
    cur = cur->next_weak_reference;
  }

  // Free unreferenced objects and reset the traced flag on referenced objects.
  for (write_i=-1,i=RogueMM_objects.count, refptr=RogueMM_objects.data-1; --i>=0; )
  {
    ref = (RogueObject*) *(++refptr);
    if (ref->__refcount >= 0)
    {
      // Untraced == unreferenced
      Rogue_destroy_object( ref );
    }
    else
    {
      // Still referenced. Reset flag.
      ref->__refcount = ~ref->__refcount;
      RogueMM_objects.data[++write_i] = ref;
    }
  }
  RogueMM_objects.count = write_i + 1;

  end_i = RogueMM_objects_requiring_cleanup.count;
  refptr = RogueMM_objects_requiring_cleanup.data + end_i;
  for (i=end_i; --i>=0; )
  {
    ref = (RogueObject*) *(--refptr);
    ref->__refcount = ~ref->__refcount;
  }

  // Call on_cleanup() the (formerly, perhaps currently) unreferenced objects
  // requiring cleanup. These are all at the end of the regular object list:
  // the last 'cleanup_count' objects on that list.
  end_i  = RogueMM_objects.count;
  refptr = RogueMM_objects.data + end_i;
  for (i=cleanup_count; --i>=0; )
  {
    ref = (RogueObject*) *(--refptr);
    ref->__type->fn_on_cleanup( ref );
  }

  //printf("New object count:%d\n",RogueMM_objects.count);

}

